INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 1, 160, 0.029, 1, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 0, 1, 0, 1.5, 1, 101, 105, 122601);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 0, 120, 0.014, 3, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 1, 2, 0, 2.5, 2, 102, 111, 122401);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 0, 350, 0.017, 2, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 0, 3, 1, 2.5, 3, 103, 105, 122501);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 0, 130, 0.016, 3, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 1, 4, 0, 1.5, 4, 104, 105, 107501);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 1, 160, 0.014, 1, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 0, 5, 0, 2.5, 5, 105, 105, 107601);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (120, 0, 255, 0.029, 2, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 0, 6, 1, 3.5, 6, 106, 103, 107801);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (120, 1, 160, 0.013, 1, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 0, 7, 0, 3.5, 7, 107, 103, 110601);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 0, 350, 0.014, 2, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 0, 8, 1, 2.5, 8, 108, 103, 110401);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 0, 130, 0.012, 3, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 1, 9, 0, 1.5, 9, 109, 100, 110501);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 1, 200, 0.014, 1, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 0, 10, 0, 2.5, 10, 110, 103, 115701);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 0, 350, 0.071, 2, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 0, 11, 1, 2.5, 11, 111, 103, 113601);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (120, 0, 130, 0.014, 3, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 1, 12, 0, 1.5, 12, 112, 103, 107901);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 1, 200, 0.022, 2, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 0, 13, 0, 1.5, 13, 113, 105, 108001);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 1, 160, 0.031, 1, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 0, 14, 0, 2.5, 14, 114, 108, 110301);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 0, 130, 0.036, 1, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 1, 15, 0, 0.5, 15, 115, 105, 107701);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 0, 350, 0.048, 2, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 0, 16, 1, 3.5, 16, 116, 95, 113101);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 0, 130, 0.043, 3, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 1, 17, 0, 1.5, 17, 117, 105, 113301);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 0, 130, 0.018, 2, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 1, 18, 0, 1.5, 18, 118, 95, 113201);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 1, 160, 0.021, 2, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 0, 19, 0, 2.5, 19, 119, 108, 117001);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 0, 255, 0.036, 1, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 0, 20, 1, 2.5, 20, 120, 105, 113501);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 0, 350, 0.02, 3, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 0, 21, 1, 2.5, 21, 121, 105, 113401);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 0, 130, 0.018, 1, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 1, 22, 0, 2.5, 22, 122, 105, 110101);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 1, 160, 0.03, 3, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 0, 23, 0, 3.5, 23, 123, 111, 110001);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 0, 130, 0.027, 1, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 1, 24, 0, 1.5, 24, 124, 103, 117201);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 1, 160, 0.02, 2, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 0, 25, 0, 3.5, 25, 125, 108, 117301);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 0, 350, 0.04, 3, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 0, 26, 1, 2.5, 26, 126, 105, 117401);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 0, 350, 0.009, 1, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 0, 27, 1, 3.5, 27, 127, 105, 117101);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (120, 0, 255, 0.022, 1, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 0, 28, 1, 3.5, 28, 128, 105, 122901);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 0, 130, 0.028, 3, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 1, 29, 0, 2.5, 29, 129, 105, 122801);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 1, 130, 0.023, 2, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 0, 30, 0, 3.5, 30, 130, 108, 122701);
